import {Nav , Navbar,Form,Button,FormControl, Container, } from 'react-bootstrap';

class LayoutFooter extends Component{

    render() {
        return(
            <div>
                <div id="footer-layout" className="mt-2">
                    {/*<div className="footer-layout-top mb-lg-2">*/}
                        {/*<Container>*/}
